Static variables are those variables that retain their values between different function calls. Static variables are initialized only once at compile time and they have internal linkage. Static variables can be either global or local.
Register variables are those variables that are stored in a register instead of RAM. The register keyword is used to declare a register variable. The compiler may not store the variable in a register, it is only a request to the compiler to store the variable in a register. Register variables have no linkage and they are used to increase the speed of the program.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // static variable
    register int y = 20; // register variable
    x++;
    y++;
    printf("x = %d, y = %d\n", x, y);
}

int main() {
    func();
    func();
    return 0;
}
```
In this example, the variable `x` is a static variable and it retains its value between different function calls. The variable `y` is a register variable and it is stored in a register instead of RAM.

The output of this program will be:
```
x = 11, y = 21
x = 12, y = 21
```
As you can see, the value of `x` is retained between different function calls, but the value of `y` is not. This is because `x` is a static variable and `y` is a register variable.

