Constant folding is a technique where the compiler evaluates constant expressions at compile-time, rather than at runtime.

Example:
```c
int x = 2 + 3;
```
The compiler can evaluate the expression `2 + 3` at compile-time and replace it with the constant value `5`. The resulting machine code will simply load the value `5` into the variable `x`.

