function pack(entities) {
  const totalBits = entities.length * 7;
  const arrayBuffer = new ArrayBuffer(Math.ceil(totalBits / 8));
  const dataView = new DataView(arrayBuffer);

  let offset = 0;
  for (const entity of entities) {
    const id = entity.id;
    const size = entity.size;
    const byte = (id << 3) | size;
    dataView.setUint8(offset, byte);
    offset++;
  }

  return arrayBuffer;
}

function unpack(arrayBuffer) {
  const dataView = new DataView(arrayBuffer);
  const entities = [];

  for (let offset = 0; offset < arrayBuffer.byteLength; offset++) {
    const byte = dataView.getUint8(offset);
    const id = byte >> 3;
    const size = byte & 0x7;
    entities.push({ id, size });
  }

  return entities;
}
```
